import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

import { api } from "../../services/apiClient";
import { IActivityCategory } from "../../services/hooks/useActivityCategories";
import { IChart } from "../../services/hooks/useCharts";
import { ICourse } from "../../services/hooks/useCourses";
import { IInstitution } from "../../services/hooks/useInstitutions";
import { IStudentActivity } from "../../services/hooks/useStudentActivities";
import { IUser } from "../../services/hooks/useUsers";

const generateFormActivitiesPDF = async (
  studentActivities: IStudentActivity[],
): Promise<void> => {
  pdfMake.vfs = pdfFonts.pdfMake.vfs;

  const totalFinalApprovedHours = studentActivities.reduce(
    (acc, studentActivity) => {
      return acc + studentActivity.approvedHours;
    },
    0,
  );

  let semesterSubtotalHours = [];
  let subtotalApprovedHours: number;
  let countLine = 0;
  let student: IUser;
  let course: ICourse;
  let chart: IChart;
  let activityCategories: IActivityCategory[];
  let institution: IInstitution;

  await api
    .get(`users/by-id?userId=${studentActivities[0].userId}`)
    .then(response => {
      student = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  await api
    .get(`courses/by-id?courseId=${student.courseId}`)
    .then(response => {
      course = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  await api
    .get(`charts/by-student-id?studentId=${studentActivities[0].userId}`)
    .then(response => {
      chart = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  await api
    .get(`activity-categories/by-chart-id?chartId=${chart.id}`)
    .then(response => {
      activityCategories = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  await api
    .get(`institutions/by-id?institutionId=${student.institutionId}`)
    .then(response => {
      institution = response.data;
    })
    .catch(error => {
      console.log(error.response.data.message);
    });

  const header = [
    {
      alignment: "center",
      fontSize: 7,
      margin: [0, 5, 0, 0],
      text: [
        "MINISTÉRIO DA EDUCAÇÃO\n",
        "SECRETARIA DE EDUCAÇÃO PROFISSIONAL E TECNOLÓGICA\n",
        student.institutionName.toUpperCase(),
        {
          fontSize: 9,
          text: "\n___________________________________________________________________________________________________________________________________________________________________________________________________________",
        },
      ],
    },
  ];

  function contentTablesBodyData(categoryId: string) {
    const activities = chart.activities.filter(
      activity => activity.categoryId === categoryId,
    );

    return activities.map(activity => {
      countLine += 1;
      let totalApprovedHours = 0;

      const hours = [];

      const [semester, year] = student.initialSemester.split("/");
      let semesterConverted = Number(semester);
      let yearConverted = Number(year);

      semesterSubtotalHours = [];

      for (let i = 0; i < course.numberPeriods; i += 1) {
        let currentSemester = "";

        if (i > 0) {
          if (semesterConverted === 1) {
            semesterConverted = 2;
          } else {
            semesterConverted = 1;
            yearConverted += 1;
          }
        }

        currentSemester = `${semesterConverted}/${yearConverted}`;

        const totalHours = studentActivities.reduce((acc, studentActivity) => {
          if (
            studentActivity.semester === currentSemester &&
            studentActivity.activityId === activity.id
          ) {
            return acc + studentActivity.hours;
          }
          return acc + 0;
        }, 0);

        const totalApprovedHoursAcc = studentActivities.reduce(
          (acc, studentActivity) => {
            if (studentActivity.activityId === activity.id) {
              return acc + studentActivity.approvedHours;
            }
            return acc + 0;
          },
          0,
        );

        const semesterSubtotalHoursAcc = studentActivities.reduce(
          (acc, studentActivity) => {
            if (
              studentActivity.semester === currentSemester &&
              studentActivity.categoryId === categoryId
            ) {
              return acc + studentActivity.hours;
            }
            return acc + 0;
          },
          0,
        );

        semesterSubtotalHours.push({
          fontSize: 9,
          margin: [0, 2, 0, 2],
          text: semesterSubtotalHoursAcc || "",
        });

        subtotalApprovedHours = studentActivities.reduce(
          (acc, studentActivity) => {
            if (studentActivity.categoryId === categoryId) {
              return acc + studentActivity.approvedHours;
            }
            return acc + 0;
          },
          0,
        );

        totalApprovedHours = totalApprovedHoursAcc;

        hours.push({
          fontSize: 9,
          margin: [0, 2, 0, 2],
          text: totalHours || "",
        });
      }

      return [
        { fontSize: 9, margin: [0, 2, 0, 2], text: countLine },
        { fontSize: 9, margin: [0, 2, 0, 2], text: activity.name },
        {
          fontSize: 9,
          margin: [0, 2, 0, 2],
          text: `${activity.minHours} horas por certificado`,
        },
        {
          fontSize: 9,
          margin: [0, 2, 0, 2],
          text: `${activity.maxHours} horas`,
        },
        ...hours,
        {
          fontSize: 9,
          margin: [0, 2, 0, 2],
          fillColor: "#f2f2f2",
          text: totalApprovedHours || "",
        },
      ];
    });
  }

  function contentTables() {
    const tables = [];

    activityCategories.forEach(activityCategory => {
      const semesters = [];
      const widths = ["auto", 250, "auto", "auto"];

      for (let i = 0; i < course.numberPeriods; i += 1) {
        widths.push("auto");

        semesters.push({
          style: "tableHeader",
          alignment: "center",
          fontSize: 10,
          fillColor: "#f2f2f2",
          text: `Horas ${i + 1}º Sem.`,
        });
      }

      widths.push("auto");

      tables.push({
        margin: [0, 10, 0, 0],
        layout: "tableExample",
        table: {
          headerRows: 1,
          widths,
          body: [
            [
              {
                style: "tableHeader",
                alignment: "center",
                fontSize: 10,
                fillColor: "#f2f2f2",
                text: "N°",
              },
              {
                style: "tableHeader",
                alignment: "center",
                fontSize: 10,
                fillColor: "#f2f2f2",
                text: activityCategory.name,
              },
              {
                style: "tableHeader",
                alignment: "center",
                fontSize: 10,
                fillColor: "#f2f2f2",
                text: "Carga Horária Mínima",
              },
              {
                style: "tableHeader",
                alignment: "center",
                fontSize: 10,
                fillColor: "#f2f2f2",
                text: "Carga Horária Máxima",
              },
              ...semesters,
              {
                style: "tableHeader",
                alignment: "center",
                fontSize: 10,
                fillColor: "#f2f2f2",
                text: ["Horas Aprovadas"],
              },
            ],
            ...contentTablesBodyData(activityCategory.id),
            [
              {
                colSpan: 4,
                alignment: "right",
                fontSize: 9,
                margin: [0, 2, 0, 2],
                bold: true,
                text: "SUBTOTAL",
              },
              {},
              {},
              {},
              ...semesterSubtotalHours,
              {
                fontSize: 9,
                margin: [0, 2, 0, 2],
                fillColor: "#f2f2f2",
                text: subtotalApprovedHours,
              },
            ],
          ],
        },
      });
    });

    return tables;
  }

  const content = [
    {
      alignment: "center",
      fontSize: 12,
      bold: true,
      margin: [0, 0, 0, 10],
      text: `\nCONTROLE DAS ATIVIDADES COMPLEMENTARES DO CURSO: ${student.courseName.toUpperCase()}`,
    },
    {
      fontSize: 11,
      style: "tableExample",
      fillColor: "#e2efd9",
      color: "#538135",
      layout: {
        hLineColor() {
          return "#c5e0b3";
        },
        vLineColor() {
          return "#c5e0b3";
        },
      },
      table: {
        widths: ["*"],
        body: [
          [
            {
              text: [
                "Nome: ",
                {
                  bold: true,
                  text: `${student.name} ${student.lastName}`,
                },
              ],
            },
          ],
          [
            {
              text: [
                "Semestre de ingresso: ",
                {
                  bold: true,
                  text: student.initialSemester,
                },
              ],
            },
          ],
        ],
      },
    },
    contentTables(),
    {
      pageBreak: "before",
      alignment: "center",
      margin: [0, 10, 0, 10],
      fontSize: 11,
      style: "tableExample",
      fillColor: "#e2efd9",
      color: "#538135",
      layout: {
        hLineColor() {
          return "#c5e0b3";
        },
        vLineColor() {
          return "#c5e0b3";
        },
      },
      table: {
        widths: ["*"],
        body: [
          [
            {
              text: [
                "TOTAL DE HORAS DE ATIVIDADES COMPLEMENTARES CUMPRIDAS: ",
                {
                  bold: true,
                  text: totalFinalApprovedHours,
                },
              ],
            },
          ],
        ],
      },
    },
    {
      alignment: "center",
      fontSize: 11,
      margin: [50, 15, 50, 0],
      text: "Declaro, para todos os fins, que as informações prestadas por mim neste documento são verdadeiras e assumo toda a responsabilidade legal sobre a veracidade delas.",
    },
    {
      alignment: "center",
      fontSize: 11,
      margin: [0, 30, 0, 0],
      text: `${institution.cityName} - ${institution.stateAcronym}, _______ de _________________ de ________.`,
    },
    {
      alignment: "center",
      margin: [0, 70, 0, 0],
      fontSize: 11,
      style: "tableExample",
      color: "#538135",
      layout: "noBorders",
      table: {
        widths: ["*", "*", "*"],
        body: [
          [
            {
              color: "#000",
              text: "____________________________________________________",
            },
            {
              color: "#000",
              text: "____________________________________________________",
            },
            {
              color: "#000",
              text: "____________________________________________________",
            },
          ],
          [
            { text: "Assinatura do(a) Acadêmico(a)" },
            { text: "Assinatura do(a) Professor(a)\nCoordenador(a) de ATC" },
            { text: "Assinatura do(a) Coordenador(a)\nde Curso" },
          ],
          [{}, {}, {}],
        ],
      },
    },
  ];

  function footer(currentPage, pageCount) {
    return [
      {
        fontSize: 9,
        margin: [9, 10, 0, 0],
        text: "___________________________________________________________________________________________________________________________________________________________________________________________________________",
      },
      {
        fontSize: 9,
        margin: [20, 1, 20, 0],
        columns: [
          {
            alignment: "left",
            text: student?.courseName,
          },
          {
            alignment: "right",
            text: [
              "Página ",
              { bold: true, text: currentPage },
              " de ",
              { bold: true, text: pageCount },
            ],
          },
        ],
      },
    ];
  }

  function background() {
    return [
      {
        width: 842,
        height: 597,
        image:
          "data:image/png;base64,",
      },
    ];
  }

  const document = {
    background,
    pageSize: "A4",
    pageOrientation: "landscape",
    pageMargins: [15, 43, 15, 40],

    header: [header],
    content: [content],
    footer,
  };

  pdfMake.createPdf(document).open();
};

export { generateFormActivitiesPDF };
